(** val string_ltb : char list -> char list -> bool **)

let string_ltb s1 s2 =
  match String_as_OT.cmp s1 s2 with
  | Lt -> true
  | _ -> false

(** val lit_ltb : lit -> lit -> bool **)

let lit_ltb l1 l2 =
  match l1 with
  | Atom s -> (match l2 with
               | Atom s' -> string_ltb s s'
               | Integer _ -> false)
  | Integer x -> (match l2 with
                  | Atom _ -> true
                  | Integer x' -> Z.ltb x x')

(** val list_less :
    ('a1 -> 'a1 -> bool) -> ('a1 -> 'a1 -> bool) -> 'a1 list -> 'a1 list ->
    bool **)

let rec list_less less eq a b =
  match a with
  | [] -> (match b with
           | [] -> false
           | _ :: _ -> true)
  | x :: xs ->
    (match b with
     | [] -> false
     | y :: ys -> if eq x y then list_less less eq xs ys else less x y)

(** val list_equal : ('a1 -> 'a1 -> bool) -> 'a1 list -> 'a1 list -> bool **)

let rec list_equal eq a b =
  match a with
  | [] -> (match b with
           | [] -> true
           | _ :: _ -> false)
  | x :: xs ->
    (match b with
     | [] -> false
     | y :: ys -> if eq x y then list_equal eq xs ys else false)

(** val val_ltb : val0 -> val0 -> bool **)

let rec val_ltb k v =
  match k with
  | VNil -> (match v with
             | VCons (_, _) -> true
             | _ -> false)
  | VLit l -> (match v with
               | VLit l' -> lit_ltb l l'
               | _ -> true)
  | VPid _ ->
    (match v with
     | VNil -> true
     | VCons (_, _) -> true
     | VTuple _ -> true
     | VMap _ -> true
     | _ -> false)
  | VCons (hd, tl) ->
    (match v with
     | VCons (hd', tl') ->
       if val_eqb hd hd' then val_ltb tl tl' else val_ltb hd hd'
     | _ -> false)
  | VTuple l ->
    (match v with
     | VNil -> true
     | VCons (_, _) -> true
     | VTuple l' ->
       (||) (Nat.ltb (length l) (length l'))
         ((&&) ((=) (length l) (length l')) (list_less val_ltb val_eqb l l'))
     | VMap _ -> true
     | _ -> false)
  | VMap l ->
    (match v with
     | VNil -> true
     | VCons (_, _) -> true
     | VMap l' ->
       (||) (Nat.ltb (length l) (length l'))
         ((&&) ((=) (length l) (length l'))
           ((||)
             (let rec list_less0 l0 l'0 =
                match l0 with
                | [] -> (match l'0 with
                         | [] -> false
                         | _ :: _ -> true)
                | p :: xs ->
                  let (x, _) = p in
                  (match l'0 with
                   | [] -> false
                   | p0 :: ys ->
                     let (x', _) = p0 in
                     if val_eqb x x' then list_less0 xs ys else val_ltb x x')
              in list_less0 l l')
             ((&&) (list_equal val_eqb (map fst l) (map fst l'))
               (let rec list_less0 l0 l'0 =
                  match l0 with
                  | [] -> (match l'0 with
                           | [] -> false
                           | _ :: _ -> true)
                  | p :: xs ->
                    let (_, y) = p in
                    (match l'0 with
                     | [] -> false
                     | p0 :: ys ->
                       let (_, y') = p0 in
                       if val_eqb y y' then list_less0 xs ys else val_ltb y y')
                in list_less0 l l'))))
     | _ -> false)
  | VClos (_, id0, _, _) ->
    (match v with
     | VLit _ -> false
     | VVar _ -> false
     | VFunId _ -> false
     | VClos (_, id', _, _) -> Nat.ltb id0 id'
     | _ -> true)
  | _ -> false

(** val map_insert :
    val0 -> val0 -> (val0 * val0) list -> (val0 * val0) list **)

let rec map_insert k v m = match m with
| [] -> (k, v) :: []
| p :: ms ->
  let (k', v') = p in
  if val_ltb k k'
  then (k, v) :: ((k', v') :: ms)
  else if val_eqb k k' then m else (k', v') :: (map_insert k v ms)

(** val make_val_map : (val0 * val0) list -> (val0 * val0) list **)

let rec make_val_map = function
| [] -> []
| p :: vs -> let (k, v) = p in map_insert k v (make_val_map vs)

(** val flatten_list : ('a1 * 'a1) list -> 'a1 list **)

let rec flatten_list = function
| [] -> []
| p :: xs -> let (x, y) = p in x :: (y :: (flatten_list xs))

(** val deflatten_list : 'a1 list -> ('a1 * 'a1) list **)

let rec deflatten_list = function
| [] -> []
| x :: l0 ->
  (match l0 with
   | [] -> []
   | y :: xs -> (x, y) :: (deflatten_list xs))

(** val match_pattern : pat -> val0 -> val0 list option **)

let rec match_pattern p e =
  match p with
  | PVar -> Some (e :: [])
  | PLit l0 ->
    (match e with
     | VLit l -> if lit_beq l l0 then Some [] else None
     | _ -> None)
  | PCons (p1, p2) ->
    (match e with
     | VCons (v1, v2) ->
       (match match_pattern p1 v1 with
        | Some l1 ->
          (match match_pattern p2 v2 with
           | Some l2 -> Some (app l1 l2)
           | None -> None)
        | None -> None)
     | _ -> None)
  | PTuple pl ->
    (match e with
     | VTuple vl ->
       let rec match_and_bind_elements pl0 vl0 =
         match pl0 with
         | [] -> (match vl0 with
                  | [] -> Some []
                  | _ :: _ -> None)
         | p0 :: ps ->
           (match vl0 with
            | [] -> None
            | v :: vs ->
              (match match_pattern p0 v with
               | Some vl1 ->
                 (match match_and_bind_elements ps vs with
                  | Some vl2 -> Some (app vl1 vl2)
                  | None -> None)
               | None -> None))
       in match_and_bind_elements pl vl
     | _ -> None)
  | PMap pl ->
    (match e with
     | VMap vl ->
       let rec match_and_bind_elements pl0 vl0 =
         match pl0 with
         | [] -> (match vl0 with
                  | [] -> Some []
                  | _ :: _ -> None)
         | y :: ps ->
           let (p1, p2) = y in
           (match vl0 with
            | [] -> None
            | y0 :: vs ->
              let (v1, v2) = y0 in
              (match match_pattern p1 v1 with
               | Some vl1 ->
                 (match match_pattern p2 v2 with
                  | Some vl1' ->
                    (match match_and_bind_elements ps vs with
                     | Some vl2 -> Some (app vl1 (app vl1' vl2))
                     | None -> None)
                  | None -> None)
               | None -> None))
       in match_and_bind_elements pl vl
     | _ -> None)
  | PNil -> (match e with
             | VNil -> Some []
             | _ -> None)

(** val match_pattern_list : pat list -> valSeq -> val0 list option **)

let rec match_pattern_list pl vl =
  match pl with
  | [] -> (match vl with
           | [] -> Some []
           | _ :: _ -> None)
  | p :: ps ->
    (match vl with
     | [] -> None
     | v :: vs ->
       (match match_pattern p v with
        | Some vs' ->
          (match match_pattern_list ps vs with
           | Some vs'' -> Some (app vs' vs'')
           | None -> None)
        | None -> None))

