(** val is_shallow_proper_list : val0 -> bool **)

let rec is_shallow_proper_list = function
| VNil -> true
| VCons (_, y) -> is_shallow_proper_list y
| _ -> false

(** val eval_append : val0 -> val0 -> redex **)

let rec eval_append v1 v2 =
  match v1 with
  | VNil -> RValSeq (v2 :: [])
  | VCons (x, y) ->
    (match eval_append y v2 with
     | RValSeq vs ->
       (match vs with
        | [] ->
          RExc
            (badarg (VTuple ((VLit (Atom
              ('+'::('+'::[])))) :: (v1 :: (v2 :: [])))))
        | res :: l ->
          (match l with
           | [] -> RValSeq ((VCons (x, res)) :: [])
           | _ :: _ ->
             RExc
               (badarg (VTuple ((VLit (Atom
                 ('+'::('+'::[])))) :: (v1 :: (v2 :: [])))))))
     | _ ->
       RExc
         (badarg (VTuple ((VLit (Atom
           ('+'::('+'::[])))) :: (v1 :: (v2 :: []))))))
  | _ ->
    RExc
      (badarg (VTuple ((VLit (Atom ('+'::('+'::[])))) :: (v1 :: (v2 :: [])))))

(** val subtract_elem : val0 -> val0 -> val0 **)

let rec subtract_elem v1 v2 =
  match v1 with
  | VNil -> VNil
  | VCons (x, y) ->
    if val_eqb x v2 then y else VCons (x, (subtract_elem y v2))
  | _ -> errorVal

(** val eval_subtract : val0 -> val0 -> redex **)

let rec eval_subtract v1 v2 =
  if (&&) (is_shallow_proper_list v1) (is_shallow_proper_list v2)
  then (match v2 with
        | VNil -> RValSeq (v1 :: [])
        | VCons (hd, tl) -> eval_subtract (subtract_elem v1 hd) tl
        | _ ->
          RExc
            (badarg (VTuple ((VLit (Atom
              ('-'::('-'::[])))) :: (v1 :: (v2 :: []))))))
  else RExc
         (badarg (VTuple ((VLit (Atom
           ('-'::('-'::[])))) :: (v1 :: (v2 :: [])))))

(** val split_cons : int -> val0 -> (val0 * val0) option **)

let rec split_cons n0 v =
  (fun fO fS n -> if n=0 then fO () else fS (n-1))
    (fun _ -> Some (VNil, v))
    (fun n' ->
    match v with
    | VCons (hd, tl) ->
      (match split_cons n' tl with
       | Some p -> let (v1, v2) = p in Some ((VCons (hd, v1)), v2)
       | None -> None)
    | _ -> None)
    n0

(** val eval_split : val0 -> val0 -> redex **)

let eval_split v1 v2 =
  match v1 with
  | VLit l ->
    (match l with
     | Atom _ ->
       RExc
         (badarg (VTuple ((VLit (Atom
           ('s'::('p'::('l'::('i'::('t'::[]))))))) :: (v1 :: (v2 :: [])))))
     | Integer i ->
       if Z.ltb i 0
       then RExc
              (badarg (VTuple ((VLit (Atom
                ('s'::('p'::('l'::('i'::('t'::[]))))))) :: (v1 :: (v2 :: [])))))
       else (match split_cons (Z.to_nat i) v2 with
             | Some p ->
               let (v3, v4) = p in RValSeq ((VTuple (v3 :: (v4 :: []))) :: [])
             | None ->
               RExc
                 (badarg (VTuple ((VLit (Atom
                   ('s'::('p'::('l'::('i'::('t'::[]))))))) :: (v1 :: (v2 :: [])))))))
  | _ ->
    RExc
      (badarg (VTuple ((VLit (Atom
        ('s'::('p'::('l'::('i'::('t'::[]))))))) :: (v1 :: (v2 :: [])))))

(** val meta_to_cons : val0 list -> val0 **)

let rec meta_to_cons = function
| [] -> VNil
