(** val convert_primop_to_code_NEW : char list -> primopCode **)

let convert_primop_to_code_NEW s =
  if eqb0 s
       ('m'::('a'::('t'::('c'::('h'::('_'::('f'::('a'::('i'::('l'::[]))))))))))
  then PMatchFail
  else if eqb0 s ('r'::('a'::('i'::('s'::('e'::[])))))
       then PRaise
       else if eqb0 s
                 ('r'::('e'::('c'::('v'::('_'::('n'::('e'::('x'::('t'::[])))))))))
            then PRecvNext
            else if eqb0 s
                      ('r'::('e'::('c'::('v'::('_'::('p'::('e'::('e'::('k'::('_'::('m'::('e'::('s'::('s'::('a'::('g'::('e'::[])))))))))))))))))
                 then PPeekMsg
                 else if eqb0 s
                           ('r'::('e'::('m'::('o'::('v'::('e'::('_'::('m'::('e'::('s'::('s'::('a'::('g'::('e'::[]))))))))))))))
                      then PRemoveMsg
                      else if eqb0 s
                                ('r'::('e'::('c'::('v'::('_'::('w'::('a'::('i'::('t'::('_'::('t'::('i'::('m'::('e'::('o'::('u'::('t'::[])))))))))))))))))
                           then PRecvWaitTimeout
                           else PNothing

(** val eval_primop_error_NEW :
    char list -> val0 list -> exception0 option **)

let eval_primop_error_NEW fname params =
  match convert_primop_to_code_NEW fname with
  | PMatchFail ->
    (match params with
     | [] -> None
     | val1 :: l ->
       (match l with
        | [] -> Some ((Error, val1), VNil)
        | _ :: _ -> None))
  | PRaise ->
    (match params with
     | [] -> None
     | stacktrace :: l ->
       (match l with
        | [] -> None
        | reas :: l0 ->
          (match l0 with
           | [] -> Some ((Error, reas), stacktrace)
           | _ :: _ -> None)))
  | _ -> Some (undef (VLit (Atom fname)))

(** val primop_eval_NEW :
    char list -> val0 list -> (redex * sideEffect option) option **)

let primop_eval_NEW fname params =
  match convert_primop_to_code_NEW fname with
  | PMatchFail ->
    (match eval_primop_error_NEW fname params with
     | Some exc -> Some ((RExc exc), None)
     | None -> None)
  | PRaise ->
    (match eval_primop_error_NEW fname params with
     | Some exc -> Some ((RExc exc), None)
     | None -> None)
  | PNothing -> Some ((RExc (undef (VLit (Atom fname)))), None)
  | _ -> None

(** val convert_string_to_code_NEW : (char list * char list) -> bIFCode **)

let convert_string_to_code_NEW = function
| (sf, sn) ->
  if eqb0 sf ('e'::('r'::('l'::('a'::('n'::('g'::[]))))))
  then if eqb0 sn ('+'::[])
       then BPlus
       else if eqb0 sn ('-'::[])
            then BMinus
            else if eqb0 sn ('*'::[])
                 then BMult
                 else if eqb0 sn ('/'::[])
                      then BDivide
                      else if eqb0 sn ('b'::('s'::('l'::[])))
                           then BSl
                           else if eqb0 sn ('b'::('s'::('r'::[])))
                                then BSr
