(** val deadActions : deadProcess -> pID -> action list **)

let deadActions p selfPID =
  let links = pids_toList (dead_domain p) in
  let rec f = function
  | [] -> []
  | linkPID :: l' ->
    (match dead_lookup linkPID p with
     | Some reason ->
       (ASend (selfPID, linkPID, (SExit (reason, true)))) :: (f l')
     | None -> f l')
  in f links

type 'a ne_list =
| Ne_single of 'a
| Ne_cons of 'a * 'a ne_list

(** val nth_error_ne : 'a1 ne_list -> int -> 'a1 option **)

let rec nth_error_ne l n0 =
  (fun fO fS n -> if n=0 then fO () else fS (n-1))
    (fun _ ->
    match l with
    | Ne_single x -> Some x
    | Ne_cons (x, _) -> Some x)
    (fun n' ->
    match l with
    | Ne_single _ -> None
    | Ne_cons (_, l') -> nth_error_ne l' n')
    n0

(** val length_ne : 'a1 ne_list -> int **)

let rec length_ne = function
| Ne_single _ -> Stdlib.Int.succ 0
| Ne_cons (_, l') -> Stdlib.Int.succ (length_ne l')

(** val delete_nth_ne : 'a1 ne_list -> int -> 'a1 ne_list option **)

let rec delete_nth_ne l n0 =
  (fun fO fS n -> if n=0 then fO () else fS (n-1))
    (fun _ ->
    match l with
    | Ne_single _ -> None
    | Ne_cons (_, l') -> Some l')
    (fun n' ->
    match l with
    | Ne_single _ -> None
    | Ne_cons (x, l') ->
      (match l' with
       | Ne_single _ ->
         ((fun fO fS n -> if n=0 then fO () else fS (n-1))
            (fun _ -> Some (Ne_single x))
            (fun _ -> None)
            n')
       | Ne_cons (_, _) ->
         (match delete_nth_ne l' n' with
          | Some l'' -> Some (Ne_cons (x, l''))
          | None -> None)))
    n0

type rRConfig =
| RREmpty
| RRConf of pID ne_list * int

(** val currPID : rRConfig -> pID option **)

let currPID = function
| RREmpty -> None
| RRConf (l, n0) -> nth_error_ne l n0

(** val nextConf : rRConfig -> rRConfig **)

let nextConf = function
| RREmpty -> RREmpty
| RRConf (l, n0) ->
  if Nat.ltb (Stdlib.Int.succ n0) (length_ne l)
  then RRConf (l, (Stdlib.Int.succ n0))
  else RRConf (l, 0)

(** val insertToConf : rRConfig -> pID -> rRConfig **)

let insertToConf conf p =
  match conf with
  | RREmpty -> RRConf ((Ne_single p), 0)
  | RRConf (l, n0) -> RRConf ((Ne_cons (p, l)), (Stdlib.Int.succ n0))

(** val newConfByAction : rRConfig -> action -> rRConfig **)

let newConfByAction conf = function
| ASpawn (newPID, _, _, _) -> insertToConf conf newPID
| _ -> conf

(** val delCurrFromConf : rRConfig -> rRConfig **)

let delCurrFromConf = function
| RREmpty -> RREmpty
| RRConf (l, n0) ->
  (match delete_nth_ne l n0 with
   | Some l' ->
     ((fun fO fS n -> if n=0 then fO () else fS (n-1))
        (fun _ -> RRConf (l', (pred (length_ne l'))))
        (fun n' -> RRConf (l', n'))
        n0)
   | None -> RREmpty)

