(** val nodeSimpleStep :
    node -> (pID, pID * pID) sum -> (node * action) option **)

let nodeSimpleStep pat0 op =
  let (eth, prs) = pat0 in
  (match op with
   | Inl selfPID ->
     (match (PIDMap.find_opt) selfPID prs with
      | Some p0 ->
        (match p0 with
         | Inl p ->
           let a =
             nonArrivalAction p selfPID
               (pids_fresh (unavailablePIDs (eth, prs)))
           in
           (match interProcessStepFunc (eth, prs) a selfPID with
            | Some node' -> Some (node', a)
            | None -> None)
         | Inr p ->
           (match deadActions p selfPID with
            | [] -> None
            | a :: _ ->
              (match interProcessStepFunc (eth, prs) a selfPID with
               | Some node' -> Some (node', a)
               | None -> None)))
      | None -> None)
   | Inr p ->
     let (srcPID, dstPID) = p in
     (match (PIDPIDMap.find_opt) (srcPID, dstPID) eth with
      | Some l ->
        (match l with
         | [] -> None
         | v :: _ ->
           let a = AArrive (srcPID, dstPID, v) in
           (match interProcessStepFunc (eth, prs) a dstPID with
            | Some node' -> Some (node', a)
            | None -> None))
      | None -> None))

(** val interProcessStepFuncFast :
    node -> pID -> (pID, pID * pID) sum -> ((node * action) * pID) option **)

let interProcessStepFuncFast pat0 hiPID op =
  let (eth, prs) = pat0 in
  (match op with
   | Inl pid ->
     (match (PIDMap.find_opt) pid prs with
      | Some p0 ->
        (match p0 with
         | Inl p ->
           let a = nonArrivalAction p pid (Stdlib.Int.succ hiPID) in
           (match a with
            | ASend (sourcePID, destPID, sig0) ->
              if (=) sourcePID pid
              then (match processLocalStepFunc (Inl p) a with
                    | Some p' ->
                      Some ((((etherAddNew sourcePID destPID sig0 eth),
                        ((PIDMap.add) pid p' prs)), a), hiPID)
                    | None -> None)
              else None
            | AArrive (_, _, _) -> None
            | ASelf selfPID ->
              if (=) selfPID pid
              then (match processLocalStepFunc (Inl p) a with
                    | Some p' ->
                      Some (((eth, ((PIDMap.add) pid p' prs)), a), hiPID)
                    | None -> None)
              else None
            | ASpawn (freshPID, v1, v2, link_flag) ->
              (match mk_list v2 with
               | Some l ->
                 (match create_result_NEW (IApp v1) l with
                  | Some p1 ->
                    let (r, _) = p1 in
                    (match processLocalStepFunc (Inl p) a with
                     | Some p' ->
                       Some (((eth,
                         ((PIDMap.add) freshPID (Inl (((([], r), emptyBox),
                           (if link_flag
                            then pids_singleton pid
                            else pids_empty)), false))
                           ((PIDMap.add) pid p' prs))), a), (Stdlib.Int.succ
                         hiPID))
                     | None -> None)
                  | None -> None)
               | None -> None)
            | _ ->
              (match processLocalStepFunc (Inl p) a with
               | Some p' ->
                 Some (((eth, ((PIDMap.add) pid p' prs)), a), hiPID)
               | None -> None))
         | Inr p ->
           (match deadActions p pid with
            | [] -> None
            | a :: _ ->
              (match a with
               | ASend (sourcePID, destPID, sig0) ->
                 if (=) sourcePID pid
                 then (match processLocalStepFunc (Inr p) a with
                       | Some p' ->
                         Some ((((etherAddNew sourcePID destPID sig0 eth),
                           ((PIDMap.add) pid p' prs)), a), hiPID)
                       | None -> None)
                 else None
               | _ -> None)))
      | None -> None)
   | Inr p ->
     let (srcPID, dstPID) = p in
     (match (PIDMap.find_opt) dstPID prs with
      | Some p0 ->
        (match (PIDPIDMap.find_opt) (srcPID, dstPID) eth with
         | Some l ->
           (match l with
            | [] -> None
            | v :: _ ->
              let a = AArrive (srcPID, dstPID, v) in
              (match etherPopNew srcPID dstPID eth with
               | Some p1 ->
                 let (_, eth') = p1 in
                 (match processLocalStepFunc p0 a with
                  | Some p' ->
                    Some (((eth', ((PIDMap.add) dstPID p' prs)), a), hiPID)
                  | None -> None)
               | None -> None))
         | None -> None)
      | None -> None))

(** val isDead : node -> pID -> bool **)

let isDead pat0 pid =
  let (_, prs) = pat0 in
  (match (PIDMap.find_opt) pid prs with
   | Some p0 -> (match p0 with
                 | Inl _ -> false
                 | Inr _ -> true)
   | None -> false)

(** val isTotallyDead : node -> pID -> bool **)

let isTotallyDead pat0 pid =
  let (_, prs) = pat0 in
  (match (PIDMap.find_opt) pid prs with
   | Some p0 -> (match p0 with
                 | Inl _ -> false
                 | Inr p -> (=) (dead_size p) 0)
   | None -> false)

(** val etherNonEmpty : node -> (pID * pID) list **)

let etherNonEmpty = function
| (eth, _) ->
  filter (fun k ->
    match (PIDPIDMap.find_opt) k eth with
    | Some l -> (match l with
                 | [] -> false
                 | _ :: _ -> true)
    | None -> false) ((fun eth -> List.map fst (PIDPIDMap.bindings eth)) eth)

